// src/POPOSSpace.js
import { Link } from 'react-router-dom'
import './Document.css'
import { useState } from 'react'

function Document(props) {
    // Get the
    const { name, image, id } = props
    let [data, setData] = useState(null);
    let [postDoctor, setDoctor] = useState(null);
    var doctors = []
    const getSelection = (key) => {
      //Get checkbox values of skills
        doctors.push(key);
        //const refsArray  =  foo.map(eachId => ({id: eachId, ref: createRef()}));
        //if (element.checked){
        //    outputSkills.append(document.getElementById(skills[i].skillName).value)
  
        //}
        setData(doctors);
    }

    const display = () => {
      //Get checkbox values of skills
        //doctors.push(key);
        //const refsArray  =  foo.map(eachId => ({id: eachId, ref: createRef()}));
        //if (element.checked){
        //    outputSkills.append(document.getElementById(skills[i].skillName).value)
  
        //}
        //(doctors);
  
        return data.map((doctor) => {
          return (
            <div>
              {doctor}
            </div>

          )
        });

    }
    return (
      <div className="Document">
        {data ? display() : 'loading'}
        <h1>
          <Link
            className="Document-title" // add a class name!
            to={`/details/${id}`}>
            {name}
          </Link>
        </h1>
        <Link to={`/details/${id}`}>
          <img src={`${process.env.PUBLIC_URL}/images/${image}`} width="300" height="300" alt="Hello" />
        </Link>
        
        <form>
          <label for="postDoctor"> Enter a Doctor: </label>
          <input
            type="text"
            onChange={(e) => {
              setDoctor(e.target.value);
            }}
          ></input>
            <input type="submit" onClick={() => getSelection(postDoctor)}>
              Add Doctor
              </input>
        </form>

     
      </div>
    )
    //setDoctor(doctors.append(e.target.value))

  
  }

export default Document
